window.bookSummaryJSON = "<p>If I thought working for one Fae fixer was hard, working for two should be great.</p> <p>Jack Frost stole me away from Avilion for more than kicks and giggles: Someone is plotting an attempt on Queen Nicnevin's life, and I'm just the dryad to help hunt down the assassin.</p> <p>But the underworld of Annwyn holds more than just knives in the shadows - it holds the secrets of my past and future.</p> <p>With the Wild Hunt running...well, wild, and the tensions rising between my two bosses, I might find far more than I bargained for in the world of the Unseelie.</p> <p>And when the knives come out to strike...I'd better not be in their way.</p> <p>Contains mature themes.</p>"; 
